import React, { useState } from 'react';
import '../stylesheets/home.css';
import store from "../store";
const Tasks = (store, list) => store.getState()[list].map(i =>
    <li>{i}</li>
)

class List extends React.Component {
    render() {
        return <h1>Hello, {this.props.list}</h1>;
    }
}

export default List;
